import { Morph, config } from "lively.morphic";
import { loadPart } from "lively.morphic/partsbin.js";
import { pt, Rectangle } from "lively.graphics/index.js";
import { LabeledCheckBox } from "lively.components/widgets.js";
import { serverInterfaceFor } from "lively-system-interface/index.js";
import { connect, disconnectAll } from "lively.bindings/index.js";
import { MorphicDB } from "lively.morphic/morphicdb/index.js";
import { MorphicDBPrompt } from "lively.morphic/morphicdb/tools.js";
import {LoadingIndicator}from "lively.components";

export default class MorphicDBSynchronization extends Morph {


  static get properties() {
    return {
      fromDBName: {}, fromDBServerURL: {}, fromDBSnapshotLocation: {},
      toDBName: {}, toDBServerURL: {}, toDBSnapshotLocation: {}
    }
  }

  onLoad() {
    this.reset();
  }

  setFromDB(name, serverURL, snapshotLocation) {
    this.fromDBName = name;
    this.fromDBServerURL = serverURL;
    this.fromDBSnapshotLocation = snapshotLocation;
    this.get("from db button").label = "from db: " + name
  }

  setToDB(name, serverURL, snapshotLocation) {
