    this.toDBServerURL = serverURL;
    this.toDBSnapshotLocation = snapshotLocation;
    this.get("to db button").label = "to db: " + name;
  }

  async reset() {
    // this.metadata=that.metadata
    this.setFromDB(
      MorphicDB.default.name,
      MorphicDB.default.serverURL,
      MorphicDB.default.snapshotLocation);
    this.setToDB(
      "https://sofa.typeshift.io/objectdb-morphicdb",
      "https://admin.typeshift.io/objectdb/",
      "https://admin.typeshift.io/lively.morphic/objectdb/morphicdb/snapshots/");

    this.get("changes list").selections = [];
    this.get("changes list").items = []
    this.get("changes list").itemHeight = null;

    connect(this.get("changes list"), 'selection', this, 'onSelectionChanged');
    connect(this.get("deselect all button"), 'fire', this, 'deselectAll');
    connect(this.get("select all button"), 'fire', this, 'selectAll');

    connect(this.get("sync button"), 'fire', this, 'sync');
    connect(this.get("replicate to remote button"), 'fire', this, 'replicateTo');
    connect(this.get("replicate from remote button"), 'fire', this, 'replicateFrom');

    connect(this.get("from db button"), 'fire', this, 'chooseDB1');
    connect(this.get("to db button"), 'fire', this, 'chooseDB2');

    // let cb = new LabeledCheckBox({label: "labeled checkbox", fill: null})
    // // this.get("changes list").items = []
    // this.get("changes list").itemHeight = 22
    // this.get("changes list").items = [
    //   {isListItem: true, morph: Object.assign(cb.copy(), {label: "test1"})},
    //   {isListItem: true, morph: Object.assign(cb.copy(), {label: "test2"})},
    //   {isListItem: true, morph: Object.assign(cb.copy(), {label: "test3"})},
    //   {isListItem: true, morph: Object.assign(cb.copy(), {label: "test4"})},
    // ]

  }

  selectAll() { this.get("changes list").selections = this.get("changes list").items; }

  deselectAll() {  this.get("changes list").selections = []; }

  onSelectionChanged() {
    let sels = this.get("changes list").selections;
    let details = this.get("details");
    if (!sels.length) return details.textString = "";
    return details.textString = `${sels.length} selections\n${sels.map(ea => ea.id).join("\n")}`
  }

  async showDetailsForSelection() {
    let sels = this.get("changes list").selections;

    for (let sel of sels) {

      if (sel.source === "local" || sel.source === "remote") {
        $world.execCommand("open workspace", {
          title: "db changes - " + sel.source + " - " + sel.id,
          content: JSON.stringify(sel.doc, null, 2),
          fontFamily: "monospace",
          language: "json"
        });

      } else {
        $world.execCommand("diff and open in window", {
          a: sel.docA, b: sel.docB, title: "db changes - " + sel.id,
          extent: pt(400, 500)
        });
      }
    }
  }

  async updateList() {
    let loadinIndictor = LoadingIndicator.open("fetching information...")
    this.get("changes list").items = [];
    this.get("changes list").selections = [];

    let {
          fromDBName, fromDBServerURL, fromDBSnapshotLocation,
          toDBName, toDBServerURL, toDBSnapshotLocation
        } = this,
        db1 = MorphicDB.named(fromDBName, {serverURL: fromDBServerURL, snapshotLocation: fromDBSnapshotLocation}),
        db2 = MorphicDB.named(toDBName, {serverURL: toDBServerURL, snapshotLocation: toDBSnapshotLocation}),
        _1 = await db1.initializeIfNecessary(),
        _2 = await db2.initializeIfNecessary(),
        diff = await await db1.fetchDiff(toDBName),
        items = [],
        local = diff.local.filter(ea => ea.id[0] != "_"),
        remote = diff.remote.filter(ea => ea.id[0] != "_"),
        changed = diff.changed.filter(ea => ea.id[0] != "_");

    items.push(...local.map(ea => ({isListItem: true, string: `local: ${ea.id}`, value: {source: "local", ...ea}})))
    items.push(...remote.map(ea => ({isListItem: true, string: `remote: ${ea.id}`, value: {source: "remote", ...ea}})))
    items.push(...changed.map(ea => ({isListItem: true, string: `changed: ${ea.id}`, value: {source: "changed", ...ea}})))
    this.get("changes list").items = items;

    if (!items.length)
      this.setStatusMessage("No changes, databases are in sync!")
    loadinIndictor.remove();
  }

  async chooseDB1() {
    let {fromDBName, fromDBServerURL, fromDBSnapshotLocation} = this,
        {dbName, snapshotLocation, serverURL} = await MorphicDBPrompt.open(
          fromDBName, fromDBSnapshotLocation, fromDBServerURL,
          {extent: pt(300, 128), historyId: "morphic-db-sync-from", requester: this});
    if (!dbName || !snapshotLocation || !serverURL) { return; }
    this.setFromDB(dbName, serverURL, snapshotLocation);
  }

  async chooseDB2() {
    let {toDBName, toDBServerURL, toDBSnapshotLocation} = this,
        {dbName, snapshotLocation, serverURL} = await MorphicDBPrompt.open(
          toDBName, toDBSnapshotLocation, toDBServerURL,
          {extent: pt(300, 128), historyId: "morphic-db-sync-from", requester: this});
    if (!dbName || !snapshotLocation || !serverURL) { return; }
    this.setToDB(dbName, serverURL, snapshotLocation);
  }

  async runSynchronization(method) {
      // method="replicateTo"
    let i = LoadingIndicator.open("synchronizing...");

    try {
      let {
            fromDBName, fromDBServerURL, fromDBSnapshotLocation,
            toDBName, toDBServerURL, toDBSnapshotLocation
          } = this,
          db1 = MorphicDB.named(fromDBName, {serverURL: fromDBServerURL, snapshotLocation: fromDBSnapshotLocation}),
          db2 = MorphicDB.named(toDBName, {serverURL: toDBServerURL, snapshotLocation: toDBSnapshotLocation}),
          _1 = await db1.initializeIfNecessary(),
          _2 = await db2.initializeIfNecessary(),
          sels = this.get("changes list").selections,
          onlyTypesAndNames = sels.length ? lively.lang.arr.groupByKey(sels, "id").mapGroups(ea => true) : undefined,
          synced = await db1.synchronize({
            method,
            otherDB: db2.name,
            otherDBSnapshotLocation: db2.snapshotLocation,
            onlyTypesAndNames
          });

        let {
          errors, conflicts,
          changesByTypeAndName: {pull: downloads, push: uploads}
        } = synced, report = "";

        if (errors.length) throw new Error(synced.errors.join("\n\n"))

      conflicts = (conflicts || []).filter(ea => ea.id[0] !== "_");
      if (conflicts.length) {
        report += "==> CONFLICTS <==\n"
        report += JSON.stringify(conflicts, null, 2)
        report += "\n\n\n";
      }

      if (Object.keys(downloads).length) {
        report += "-=-=-=- Downloads -=-=-=-\n\n"
        for (let typeAndName in downloads) {
          let versions = (uploads[typeAndName] || []).filter(ea => ea.kind === "versions").map(ea => ea.id);
          let commits = (uploads[typeAndName] || []).filter(ea => ea.kind === "commits").map(ea => ea.id);
          report += typeAndName + "\n";
          if (versions.length) report += "HEAD changed\n";
          if (commits.length) report += "commits changed:  " + commits.join("\n  ");
          report += "\n\n";
        }
      }

      if (Object.keys(uploads).length) {
        report += "-=-=-=- Uploads -=-=-=-\n\n"
        for (let typeAndName in uploads) {
          let versions = (uploads[typeAndName] || []).filter(ea => ea.kind === "versions").map(ea => ea.id);
          let commits = (uploads[typeAndName] || []).filter(ea => ea.kind === "commits").map(ea => ea.id);
          report += typeAndName + "\n";
          if (versions.length) report += "HEAD changed\n";
          if (commits.length) report += "commits changed:\n  " + commits.join("\n  ");
          report += "\n\n";
        }
      }

      $world.execCommand("open text window", {
        title: "synchronization summary",
        content: report
      });

      this.updateList();

    } catch(err) {
      $world.inform("Synchronization error: " + err);
    } finally {
      i && i.remove();
    }
  }

  replicateFrom() { return this.runSynchronization("replicateFrom"); }
  replicateTo() { return this.runSynchronization("replicateTo"); }
  sync() { return this.runSynchronization("sync"); }
}
